rulesList.cssText:
@media (max-width: 767px) {
  .hero-section--m365-rebrand-banner { font-size: 15px; text-align: left; }
  .hero-section--m365-rebrand-banner-text-wrapper { display: inline-block; }
  .hero-section--m365-rebrand-banner-learn-more-link { margin-left: 2px; }
  .hero-section--m365-rebrand-banner-arrow { display: none; }
}

@media (min-width: 1024px) {
  .hero, .personalization__section { margin-top: 0px; }
  .hero-section--bottom-white-gradient { display: none; }
  .width-restrictor--hero { top: 50%; left: 50%; transform: translateY(-50%) translateX(-50%); position: absolute; }
  .hero__content { margin: auto auto auto 0px; padding-bottom: 0px; text-align: left; width: 33%; }
  .hero__content.hero__content--unauth-rebrand { width: 40%; }
}

@media (min-width: 1024px) {
  .hero__button--rounded, .personalization__button--rounded { min-width: 200px; }
  .hero__button--primary, .personalization__button { border-color: rgb(255, 255, 255); margin-right: 20px; }
  .hero__button--primary:hover, .personalization__button:hover { border-color: rgb(255, 255, 255); }
}

@media (min-width: 1024px) {
  .hero__link, .hero__link:focus, .hero__link:hover { color: rgb(255, 255, 255); }
  .hero__link .animated-link--text:focus, .hero__link .animated-link--text:hover { border-color: rgb(255, 255, 255); }
  .hero__link-orange, .hero__link-orange:focus, .hero__link-orange:hover { color: rgb(216, 59, 1); }
  .hero__link-orange .animated-link--text:focus, .hero__link-orange .animated-link--text:hover { border-color: rgb(216, 59, 1); }
}

@media (max-width: 1023px) {
  .unauth-refresh__hero { height: 50vh; background-position: right center; position: relative; }
}

@media (max-width: 1083px) {
  .mobile-app-upsell__phone { margin: 24px auto 0px; text-align: center; float: unset; display: block; }
}

@media (min-width: 1024px) {
  .m365-hero-treatmentA__button--rounded { min-width: 200px; }
  .m365-hero-treatmentA__button--primary-rounded:hover { border-color: rgb(70, 79, 235); }
  .m365-hero-treatmentA__link-blue, .m365-hero-treatmentA__link-blue:focus, .m365-hero-treatmentA__link-blue:hover { color: rgb(70, 79, 235); }
  .m365-hero-treatmentA__link-blue .animated-link--text:focus, .m365-hero-treatmentA__link-blue .animated-link--text:hover { border-color: rgb(70, 79, 235); }
  .m365-hero__button--rounded { min-width: 200px; }
}

@media screen and (-ms-high-contrast:active) {
  .tab-button.tab-button--active { border-top: 2px solid; border-left: 2px solid; border-right: 2px solid; margin-bottom: -2px; z-index: 0; }
}

@media (max-width: 1083px) {
  .copilot-unauth-page-highlight.more-apps { padding: 0px; }
  .copilot-unauth-page-highlight { height: auto; width: 100%; }
  .highlight-text-container.highlight-text-container--more-apps { margin: auto; }
}

@media (max-width: 1083px) {
  .highlight-text-container { display: block; height: auto; margin: auto; }
}

@media (min-width: 1084px) {
  .highlight-text { position: absolute; padding: 0px; top: 50%; transform: translateY(-50%); }
}

@media (max-width: 1083px) {
  .float-left.highlight-text-container { float: unset; margin-right: inherit; }
  .float-left.highlight-image { float: unset; }
  .tab-button--footer { width: 208px; }
}

@media (max-width: 767px) {
  .tab-button--footer { display: block; margin: auto auto 12px; width: 320px; }
}

@media (min-width: 1084px) {
  .highlight-image { position: absolute; top: 50%; transform: translateY(-50%); }
  .unauth-tabs--footer :not(:last-child) { margin-right: 20px; }
}

@media (max-width: 539px) {
  .shy-header-container { display: flex; -webkit-box-pack: justify; justify-content: space-between; -webkit-box-align: center; align-items: center; padding: 0px; }
}

@media (max-width: 539px) {
  .shy-header span a { font-size: 12px; }
  .shy-header__office { line-height: 48px; }
  .shy-header__office-icon { display: none; }
}

@media (max-width: 539px) {
  .shy-header__button { -webkit-box-pack: center; justify-content: center; line-height: 16px; width: 33%; height: calc(100% - 8px); text-align: center; font-size: 14px; white-space: normal; }
  .shy-header__button.shy-header__button--edu { width: 50%; }
}

