  .mectrl_focus_visible .mectrl_currentAccount button.mectrl_signout:focus { background-color: indigo; }
  .mectrl_currentAccount button.mectrl_signout:hover { background-color: indigo; }
  .mectrl_currentAccount button.mectrl_signout:active { background-color: indigo; }
  .mectrl_focus_visible .mectrl_currentAccount a.mectrl_signout:focus { text-decoration: underline; }
